import React, { Component } from 'react';
import TeamCard from "./TeamCard";
import Container from './Container';
// import './css/Containercss.css';
import './css/general.css';


class Team extends Component {
  render() {
    return (
      <>
      <Container />
        <TeamCard />
      </>
    );
  }
}
export default Team;
